/* CAROUSEL RATE---------- */
jQuery.fn.scRate = function(){
	return this.each(function() {
	        var a = $(this),
	            e = parseInt(a.find(".card__short-rate--num").text());
	        if ( e > 5 ) {    
		        a.append("<div class='card__short-rate--perc high'>" + e + "</div>"), setTimeout(function() {
		            a.circleProgress({
		                size: 32,
		                thickness: 3,
		                startAngle: -1.5,
		                animation: false,
		                lineCap: "round",
		                value: e / 10,
		                emptyFill: "#def6de",
		                fill: {
		                    gradient: ["#3fd03f"]
		                }
		            })
		        }, 400);
	        } else if ( e < 5 ) {
	        	a.append("<div class='card__short-rate--perc low'>" + e + "</div>"), setTimeout(function() {
		            a.circleProgress({
		                size: 32,
		                thickness: 3,
		                startAngle: -1.5,
		                animation: false,
		                lineCap: "round",
		                value: e / 10,
		                emptyFill: "#ffe1e1",
		                fill: {
		                    gradient: ["#ff4141"]
		                }
		            })
		        }, 400);
	        }
	  function destroy() {
			this.remove();
			$(window).unbind("resize");
		}    
	});
};
