/* TABS---------- */
$(function() {
  function ShowNewPanel(theLink, theTab, thePane) {
    theTab.find('.tab__pane.active').fadeOut(200, function() {
      $(this).removeClass('active');
      $(thePane).fadeIn(200, function() {
        $(this).addClass('active');
      });
    });
    theTab.find('.tab__nav li').removeClass('active');
    theTab.find('.tab__nav a[href="'+thePane+'"]').parent('li').addClass('active');
  }
  $('.tab .tab__nav ul li a, a.tab__anchor').on('click', function() {
    var $theLink = $(this);
    var $theTab = $theLink.closest('.tab');
    var $thePane = $theLink.attr('href');
    ShowNewPanel($theLink, $theTab, $thePane)
  });
});

$(function() { 
var tabCookieName = "ui-tabs"; 
    var location = $.cookie(tabCookieName);
    if (location) {
      $('#content__tabs a[href="' + location + '"]').tab('show');
    }
    $('#content__tabs a').click(function(e) {
      e.preventDefault()
      $(this).tab('show')
    })
    $('#content__tabs a').on('shown.bs.tab', function(e) {
      location = e.target.hash; 
      $.cookie(tabCookieName, location, {
        path: '/'
      }); 
    })
});

/* SCROLL ITEM EFFECT---------- */
(function ( $ ) {
    $.fn.pullupScroll = function(e) {
    	$(e).addClass('pullup__element');
    	$(e).each(function(i, el) {
  			var el = $(el);
  			if (el.visible(true)) {
    		el.addClass("already__visible"); 
  		} 
		});
        return this;
    };
	$.fn.visible = function(partial) {
		      var $t        = $(this),
	          $w            = $(window),
	          viewTop       = $w.scrollTop(),
	          viewBottom    = viewTop + $w.height(),
	          _top          = $t.offset().top,
	          _bottom       = _top + $t.height(),
	          compareTop    = partial === true ? _bottom : _top,
	          compareBottom = partial === true ? _top : _bottom;
	    
	    return ((compareBottom <= viewBottom) && (compareTop >= viewTop));
  };
}( jQuery ));

function scrollFn() { 
  $(".pullup__element").each(function(i, el) {
    var el = $(el);
    if (el.visible(true)) {
      el.addClass("come__in"); 
    }  
});
}

